import Task from "./task";
import { Droppable } from "react-beautiful-dnd";
const Column = ({ column, tasks }) => {
  console.log("colum", column.title);
  return (
    <>
    <Droppable></Droppable>
      <div className="cssforColumn">
        <h1> {column.title}</h1>
        <h2>
          {tasks.map((task) => (
            <Task key={task.id} task={task}></Task>
          ))}
        </h2>
      </div>
    </>
  );
};
export default Column;
